Americas Lost Treasures

History Documentary hosted by Kinga Philipps and Curt Doussett, published by National Geographic in 2012 - English narration


Information
------------------------------

America's Lost Treasures
Across America there are forgotten links to our history. Family heirlooms and found objects with unexpected value and amazing stories just waiting to be discovered. Each episode of America's Lost Treasures will follow our team of two cast members on their quest to find these treasures, uncover their stories, and choose one item that deserves to take its place in a museum. The chosen object each episode will be on loan to the National Geographic Society's special exhibition of America's Lost Treasures, and the object owner will receive a $10,000 award.



9)  Wilmington Delaware 
At the Winterthur Museum in Wilmington, Del., Curt Doussett and Kinga Philipps are discovering amazing treasures that turn out to be worth thousands of dollars. Curt loves the rare, historical significance of Rev. Isaac Leesers silver goblet, which is worth around $80,000. Kinga is thrilled with the fine needlework quality and significance of the schoolgirl needlework sampler, appraised for $25,000. Alas, only one can win!


